The '''.43 Egyptian''' was a [[Centerfire ammunition|centerfire]] [[Cartridge (firearms)|cartridge]] used by Egypt and France in the No. 1 Remington Military Rifle.<ref name=ammo>{{cite web|title=THE CARTRIDGE COLLECTOR'S EXCHANGE|url=http://www.oldammo.com/november08.htm|publisher=oldammo.com|accessdate=27 November 2013}}</ref> <ref name=military>{{cite web|title=Egypt Remington - Military Rifles|url=http://www.militaryrifles.com/Egypt/EgyptRem.htm|publisher=militaryrifles.com|accessdate=27 November 2013}}</ref> <ref name=google>{{cite web|title=Cartridges of the World: A Complete and Illustrated Reference for ...|url=http://books.google.com.np/books?id=3_-kUkNXTNwC&pg=PA360&lpg=PA360&dq=43+egyptian+cartridge+history&source=bl&ots=Y4OK3nIirD&sig=9O0xE0a2kY40dfavMklCUKAfjpE&hl=en&sa=X&ei=yiqWUpelDsikrQfg-YD4Dw&ved=0CFsQ6AEwBQ#v=onepage&q=43%20egyptian%20cartridge%20history&f=false|publisher=booksgoogle.com.np|accessdate=27 November 2013}}</ref>
